public class Solution {
    public int[][] ConstructProductMatrix(int[][] grid) {
        int n = grid.Length;
        int m = grid[0].Length;
        int[][] result = new int[n][];

        // Initialize result matrix with 1s
        for (int i = 0; i < n; i++) {
            result[i] = new int[m];
            for (int j = 0; j < m; j++) {
                result[i][j] = 1; // Initialize with 1 as a neutral element for multiplication
            }
        }

        // Calculate product of all elements except self
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                int product = 1;
                // Multiply all elements except the current one
                for (int x = 0; x < n; x++) {
                    for (int y = 0; y < m; y++) {
                        if (x != i || y != j) {
                            product = (product * grid[x][y]) % 12345;
                        }
                    }
                }
                result[i][j] = product;
            }
        }

        return result;
    }
}
